import React from "react";
import { Route, Routes } from "react-router-dom";
import { Home } from "./Pages/Home";
import Profile from "./Pages/Profile";


function App() {
  return (

        <Routes>
          <Route path="/" Component={<Home/>}/>
          <Route path="/Profile" Component={<Profile/>}/>
        </Routes>


  );
}

export default App;
